import React, { Component } from 'react';
import GridItem from "components/Grid/GridItem.jsx";
import GridContainer from "components/Grid/GridContainer.jsx";
import Table from "components/Table/Table.jsx";
import Card from "components/Card/Card.jsx";
import CardHeader from "components/Card/CardHeader.jsx";
import CardBody from "components/Card/CardBody.jsx";
import Button from "components/CustomButtons/Button.jsx";


//import { table, Button,Form,FormGroup,Label,Input } from 'reactstrap';
export class FormProduct extends Component {
  render() {

    return (

	  <Card profile>
		 <h1 className='font-weight-bold text-center'>Detalle de Productos</h1>	
	  </Card>

    );
  }
}

export class ListProduct extends React.Component {

 constructor(props){
 super(props)
 console.log('guillermo0')
	 console.log(props)
 this.getHeader = this.getHeader.bind(this);
 this.getRowsData = this.getRowsData.bind(this);
 this.getKeys = this.getKeys.bind(this);
 }

 getKeys = function(){
 return Object.keys(this.props.data[0]);
 }

 getHeader = function(){
 var keys = this.getKeys();
 return keys.map((key, index)=>{
 return <th key={key}>{key.toUpperCase()}</th>
 })
 }

 getRowsData = function(){
 var items = this.props.data;
 var keys = this.getKeys();
 return items.map((row, index)=>{
 return <tr key={index}><RenderRow key={index} data={row} keys={keys}/></tr>
 })
 }

 render() {
 return (
 <div>
 <table>
 <thead>
 <tr>{this.getHeader()}</tr>
 </thead>
 <tbody>
 {this.getRowsData()}
 </tbody>
 </table>
 </div>

 );
 }
}
const RenderRow = (props) =>{
 return props.keys.map((key, index)=>{
 return <td key={props.data[key]}>{props.data[key]}</td>
 })
}

export default class ProductBox extends Component {
	url='http://localhost:85/produ3/web/app_dev.php/listadoJson/empresa';
	state={
		products:[],
		rows:[],
		data1:[{"id":"1","nombre":"Empresa"},
			{"id":"2","nombre":"corporaci\u00f3n de telefono de Venezuela "}]
	}
  componentDidMount() {
	  fetch(this.url)
			.then(response => response.json())
			/*.then(products => console.log(products))*/
			.then(products => this.setState({products}))
			.catch(e => console.log(e));
  }


  render() {

	  const products=this.state.products;
	  console.log('render11111');
	  console.log(products);
    return (
	 <GridContainer>
		<GridItem xs={6} >
			<ListProduct data = {data1}/>
		</GridItem>
		<GridItem xs={6} >	
			<FormProduct/>
		</GridItem>
	  </GridContainer>
    );
  }
}
